  false,\n\t\"url\": null,\n\t\"notes\": \"The Arctic Oscillation (AO) is a leading
  teleconnection pattern in the Northern Hemisphere circulation. It is calculated
  as the first Empirical Orthogonal Function (EOF) for height anomalies poleward of
